+{
+  extern "C" void abort (void);
+  extern "C" char *strcpy (char *, const char *);
+  extern "C" int memcmp (const void *, const void *, __SIZE_TYPE__);
+}
+
+int main ()
+{
+  using namespace std;
+  char f[16];
+  
+  if (strcpy (f, "hello world") != f
