+    abort ();
+
+  if (std::strcpy (f, "bye world") != f
+      || memcmp (f, "bye world", sizeof ("bye world")))
+    abort ();
+
+  if (::__builtin_strcpy (f, "hello world") != f
+      || memcmp (f, "hello world", sizeof ("hello world")))
+    abort ();
+  
+  return 0;
+}
+
+extern "C"
+{
+  static char * ::strcpy (char *, const char *)
+  {
+    std::abort ();
+  }
+}

